import React from 'react'
import Star from "./Star";
import "../stylesheets/Circle.css"

class Circle extends React.Component {

    renderStars = () => {
        const stars = this.props.circle.stars
        return this.props.circle.stars.map(star => <Star key={star.id} star={star} />)
    }

    render(){
        console.log(this.props.circle)
        return(
            <div style={{
                width: this.props.circle.size,
                height: this.props.circle.size,
                transform: "rotate" + `(${this.props.circle.rotation_start}deg)`}}
                 className={this.props.circle.className}
            >{this.renderStars()}
            </div>
        )
    }




}

export default Circle
